import Banner from "../components/Banner";

export default function Takamatsu() {
  return (
    <div>
      <Banner
        title="高松"
        subtitle="烏龍麵之都的風與光"
        imageUrl="https://images.unsplash.com/photo-1600334129128-68ba1fc0f5f0"
      />
      <div className="mt-6 space-y-4 text-gray-700">
        <p>高松是香川縣的首府，以讚岐烏龍麵和栗林公園聞名。</p><p>這裡擁有豐富的歷史文化與寧靜的自然風景，是探索四國的最佳起點。</p>
      </div>
    </div>
  );
}
